import React from "react";
import "./styles.css";

export const Card = () => {
  return (
    <div className="container">
      <div className="head">
        <p>Vans</p>
        <p>$60.00</p>
      </div>
      <img src="https://scene7.zumiez.com/is/image/zumiez/product_main_medium/Vans-Old-Skool-Love-Me-Love-Me-Not-Skate-Shoes-_175856-back-CA.jpg" />
      <div className="foot">
        <p>Vans old school Love Me</p>
        <p>black</p>
      </div>
    </div>
  );
};
